const PharmacyList = ({ list }) => {
  return (
    <>
      {list.map((item) => {
        return (
          <tr key={item.id}>
            {console.log(item.id)}
            <td>{item.name}</td>
            <td>{item.description}</td>
            <td>{item.price}</td>
            <td>
              <button id={item.id}>Add to Cart</button>
            </td>
          </tr>
        );
      })}
    </>
  );
};
export default PharmacyList;
